import React, { useState } from 'react';
import './navbar.css'
import {NavLink} from "react-router-dom";
import { useDispatch, useSelector } from 'react-redux';
import { logout } from '../../reducers/userReducer';
import { Button, Nav} from 'react-bootstrap'
const Navbar = () => {
    const isAuth = useSelector(state => state.user.isAuth)
    const dispatch = useDispatch()
    
   
    return (
        <div className="navbar">
            <div className="container">
                <NavLink to ='/'><div className="navbar__header">АС Вахтёра</div></NavLink>
                {!isAuth && <div className="navbar__login"><Nav.Link to="/login">Войти</Nav.Link></div>}
                {!isAuth && <div className="navbar__registration"><Nav.Link to="/registration">Регистрация</Nav.Link></div>}
                {isAuth && <Button onClick={()=> dispatch(logout())} variant="outline-primary">Выход</Button>}
            </div>
        </div>
    );
};

export default Navbar;
